class Form extends Component {
    
    render() { 
        return (
            <div>
                <form method='POST'>
                    <h1>Username:<input type='input'/></h1>
                    <div>
                    <input type='password' placeholder='password'/>
                    </div>
                    
                </form>
            </div>
          );
    }
}
 
export default Form ;
